import React from "react";
import CustomDropdown from "./CustomDropdown";
import { StyledContent } from "./styles/Content.styled";

function ReadySize({
  registerName,
  control,
  stitchOptions,
  errors,
  errorMessage,
  placeholder,
}) {
  return (
    
      <CustomDropdown
        registerName={registerName}
        
        options={stitchOptions}
        
      />
    
  );
}
export default ReadySize;
